// https://material-ui.com/demos/buttons/#third-party-routing-library
// const RenderButton = () => <Button component={ButtonLink} href={'/foo'}>bar</Button>

export class ButtonLink extends React.Component {
  render() {
    const { style, href, hrefAs, children, prefetch } = this.props;
    return (
      <div style={style}>
        <Link href={href} as={hrefAs} prefetch>
          <a>{children}</a>
        </Link>
      </div>
    );
  }
}
